import React from 'react';

const Footer = () => {
    return(
        <>
        <div className="row">
            <div className="col-1"></div>
                <div className="col-md-10">
                    <div className="row"></div>
                        <p className="footer">Footer</p>
                </div>
        </div>
        </>
    );
}

export default Footer;
